import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';

import HomePage from './pages/HomePage';
import ServicePage from './pages/ServicePage';
import LoginPage from './pages/LoginPage';
import SignUpPage from './pages/SignUpPage';
import AdminDashboard from './pages/AdminDashboard';
import DoctorDashboard from './pages/DoctorDashboard';
import PatientDashboard from './pages/PatientDashboard';
import PatientProfileForDoctorPage from './pages/PatientProfileForDoctorPage';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import ForgotPasswordRequestPage from './pages/ForgotPasswordRequestPage';
import ResetPasswordPage from './pages/ResetPasswordPage';
import ContactUsPage from './pages/ContactUsPage';
import HelpPage from './pages/HelpPage';
import BlogsPage from './pages/BlogsPage';

// Komponenta za zaštićene rute (Protected Route)
const ProtectedRoute = ({ children, requiredRoles }) => {
  const { isAuthenticated, hasRole, loading, userRoles: actualUserRoles } = useAuth(); // Dohvati actualUserRoles

  console.log("ProtectedRoute check: isAuthenticated:", isAuthenticated, "loading:", loading);
  console.log("ProtectedRoute check: Actual User Roles from AuthContext:", actualUserRoles);
  console.log("ProtectedRoute check: Required Roles for this route:", requiredRoles);


  if (loading) {
    console.log("ProtectedRoute: Authentication still loading...");
    return (
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', fontSize: '24px' }}>
        Loading authentication...
      </div>
    );
  }

  // Nakon što je loading završio, provjeri autentičnost
  if (!isAuthenticated) {
    console.log("ProtectedRoute: User not authenticated. Redirecting to /login.");
    return <Navigate to="/login" replace />;
  }

  // Provjera uloga
  if (requiredRoles && requiredRoles.length > 0) {
    const hasRequiredRole = requiredRoles.some(role => {
        const userHasThisRole = hasRole(role);
        console.log(`ProtectedRoute: Checking role '${role}'. User has this role: ${userHasThisRole}`);
        return userHasThisRole;
    });

    if (!hasRequiredRole) {
      console.warn("ProtectedRoute: User does NOT have required role. Redirecting to /.");
      return <Navigate to="/" replace />;
    }
  }

  console.log("ProtectedRoute: User IS authorized. Rendering children.");
  return children;
};

// Komponenta za Header (izdvojena radi preglednosti)
function AppHeader() {
  const { isAuthenticated, hasRole, logout, userEmail, loading, userRoles } = useAuth(); // Dohvati i userRoles za debug

  // NE prikazuj header dok se autentifikacija ne učita
  if (loading) {
    console.log("AppHeader: Still loading authentication, not rendering header.");
    return null; // Ili neki placeholder za header
  }
  console.log("AppHeader: User Roles for header display:", userRoles);


  return (
    <header className="d-flex justify-content-between align-items-center py-3 px-4 bg-white shadow-sm sticky-header">
      <h1 className="h3 mb-0 text-danger">WinxCare</h1>
      <nav>
        <ul className="nav">
          <li className="nav-item"><Link className="nav-link" to="/">Home</Link></li>
          <li className="nav-item"><Link className="nav-link" to="/service">Service</Link></li>
          <li className="nav-item"><Link className="nav-link" to="/contact-us">Contact Us</Link></li>
          <li className="nav-item"><Link className="nav-link" to="/help">Help</Link></li>
          <li className="nav-item"><Link className="nav-link" to="/blogs">Blogs</Link></li>
          {/* Prikazati linkove na dashboard na osnovu uloge */}
          {isAuthenticated && hasRole('ROLE_ADMIN') && (
            <li className="nav-item"><Link className="nav-link" to="/admin-dashboard">Admin Panel</Link></li>
          )}
          {isAuthenticated && hasRole('ROLE_DOKTOR') && (
            <li className="nav-item"><Link className="nav-link" to="/doctor-dashboard">Doktor Panel</Link></li>
          )}
          {isAuthenticated && hasRole('ROLE_PACIJENT') && (
            <li className="nav-item"><Link className="nav-link" to="/patient-dashboard">Pacijent Panel</Link></li>
          )}
        </ul>
      </nav>
      <div className="d-flex">
        {!isAuthenticated ? (
          <>
            <Link to="/sign-up" className="btn btn-outline-danger me-2">Sign Up</Link>
            <Link to="/login" className="btn btn-danger">Log In</Link>
          </>
        ) : (
          <>
            <span className="align-self-center me-3">Dobrodošao, {userEmail}!</span>
            <button onClick={logout} className="btn btn-danger">Log Out</button>
          </>
        )}
      </div>
    </header>
  );
}

function App() {
  return (
    <Router>
      <style>
        {`
        .nav-link { color: black !important; }
        .nav-link.active { color: #e91e63 !important; font-weight: bold; }
        .nav-link:hover { color: #e91e63 !important; }
        .sticky-header {
          position: sticky;
          top: 0;
          z-index: 1020;
          width: 100%;
          background-color: white;
        }
        `}
      </style>
      <AuthProvider>
        <div className="App">
          <AppHeader />

          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/service" element={<ServicePage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/sign-up" element={<SignUpPage />} />
            <Route path="/forgot-password" element={<ForgotPasswordRequestPage />} />
            <Route path="/reset-password" element={<ResetPasswordPage />} />

            <Route
              path="/admin-dashboard"
              element={
                <ProtectedRoute requiredRoles={['ROLE_ADMIN']}>
                  <AdminDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/doctor-dashboard"
              element={
                <ProtectedRoute requiredRoles={['ROLE_DOKTOR']}>
                  <DoctorDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/patient-dashboard"
              element={
                <ProtectedRoute requiredRoles={['ROLE_PACIJENT']}>
                  <PatientDashboard />
                </ProtectedRoute>
              }
            />
            <Route
              path="/doctor/patient-profile/:patientId"
              element={
                <ProtectedRoute requiredRoles={['ROLE_DOCTOR']}>
                  <PatientProfileForDoctorPage />
                </ProtectedRoute>
              }
            />

            <Route path="/contact-us" element={<ContactUsPage />} />
            <Route path="/help" element={<HelpPage />} />
            <Route path="/blogs" element={<BlogsPage />} />
          </Routes>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
